import React, { useEffect, useState } from 'react';
import api from '../api/axios';
import { motion } from 'framer-motion';

const StudentResultsPage = () => {
  const [results, setResults] = useState([]);
  const [assessments, setAssessments] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const userId = localStorage.getItem('userId');

  useEffect(() => {
    const fetchData = async () => {
      try {
        setLoading(true);
        setError(null);

        // Get the auth token from localStorage
        const token = localStorage.getItem('token') || localStorage.getItem('authToken') || localStorage.getItem('accessToken');
        
        if (!token) {
          throw new Error('No authentication token found. Please log in again.');
        }

        // Set the authorization header
        const config = {
          headers: {
            'Authorization': `Bearer ${token}`,
            'Content-Type': 'application/json'
          }
        };

        // Fetch results and assessments with auth headers
        const [resResults, resAssessments] = await Promise.all([
          api.get('/Results', config),
          api.get('/Assessments', config)
        ]);

        // Filter results for current user (handle both string and GUID comparison)
        const userResults = resResults.data.filter(r => {
          // Handle case where userId might be stored as string but backend expects GUID
          return r.userId === userId || r.userId?.toString() === userId || r.userId?.toString().toLowerCase() === userId?.toLowerCase();
        });

        setResults(userResults);
        setAssessments(resAssessments.data);
      } catch (err) {
        console.error('Failed to fetch student results', err);
        
        if (err.response?.status === 401) {
          setError('Authentication failed. Please log in again.');
          // Optionally redirect to login page
          // window.location.href = '/login';
        } else if (err.response?.status === 403) {
          setError('You don\'t have permission to view results.');
        } else if (err.message.includes('No authentication token')) {
          setError(err.message);
        } else {
          setError('Failed to load results. Please try again later.');
        }
      } finally {
        setLoading(false);
      }
    };

    if (userId) {
      fetchData();
    } else {
      setError('No user ID found. Please log in again.');
      setLoading(false);
    }
  }, [userId]);

  const getAssessment = (assessmentId) =>
    assessments.find(a => a.assessmentId === assessmentId);

  if (loading) {
    return (
      <div className="p-6 max-w-4xl mx-auto">
        <div className="flex justify-center items-center h-64">
          <div className="animate-spin rounded-full h-12 w-12 border-b-2 border-purple-600"></div>
        </div>
      </div>
    );
  }

  if (error) {
    return (
      <div className="p-6 max-w-4xl mx-auto">
        <div className="bg-red-100 border border-red-400 text-red-700 px-4 py-3 rounded-lg">
          <h3 className="font-bold mb-2">Error</h3>
          <p>{error}</p>
          <button 
            onClick={() => window.location.reload()} 
            className="mt-3 bg-red-600 text-white px-4 py-2 rounded hover:bg-red-700 transition-colors"
          >
            Retry
          </button>
        </div>
      </div>
    );
  }

  return (
    <motion.div
      className="p-6 max-w-4xl mx-auto"
      initial={{ opacity: 0, y: 20 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
    >
      <h2 className="text-4xl font-extrabold text-transparent bg-clip-text bg-gradient-to-r from-purple-600 to-indigo-600 mb-8 text-center">
        My Results
      </h2>

      {results.length === 0 ? (
        <div className="text-center">
          <p className="text-slate-600 dark:text-slate-300 mb-4">No results found.</p>
          <p className="text-sm text-slate-500 dark:text-slate-400">
            Complete some assessments to see your results here.
          </p>
        </div>
      ) : (
        <motion.div
          className="space-y-6"
          initial="hidden"
          animate="visible"
          variants={{
            visible: {
              transition: { staggerChildren: 0.1 },
            },
          }}
        >
          {results.map((r, i) => {
            const assessment = getAssessment(r.assessmentId);
            const title = assessment?.title || 'Unknown Assessment';
            const maxScore = assessment?.maxScore || 100;
            const percentage = Math.round((r.score / maxScore) * 100);
            const isPass = percentage >= 40;

            return (
              <motion.div
                key={r.resultId}
                className="bg-white dark:bg-slate-800 border border-purple-100 dark:border-slate-700 rounded-xl shadow-md p-5"
                initial={{ opacity: 0, y: 10 }}
                animate={{ opacity: 1, y: 0 }}
                transition={{ delay: i * 0.05 }}
              >
                <div className="flex justify-between items-center mb-1">
                  <h3 className="text-lg font-semibold text-indigo-700 dark:text-indigo-300">
                    {title}
                  </h3>
                  <span
                    className={`text-xs px-3 py-1 rounded-full font-medium ${
                      isPass
                        ? 'bg-green-100 text-green-700 dark:bg-green-900 dark:text-green-300'
                        : 'bg-red-100 text-red-700 dark:bg-red-900 dark:text-red-300'
                    }`}
                  >
                    {isPass ? 'Pass' : 'Fail'}
                  </span>
                </div>

                <p className="text-sm text-slate-700 dark:text-slate-300 mb-1">
                  Score: <strong>{r.score}</strong> / {maxScore} ({percentage}%)
                </p>
                <p className="text-sm text-slate-500 dark:text-slate-400 mb-3">
                  Attempted on: {new Date(r.attemptDate).toLocaleString()}
                </p>

                <div className="w-full bg-slate-200 dark:bg-slate-700 rounded-full h-3 overflow-hidden">
                  <motion.div
                    initial={{ width: 0 }}
                    animate={{ width: `${percentage}%` }}
                    transition={{ duration: 0.7 }}
                    className={`h-3 rounded-full ${
                      isPass ? 'bg-green-500' : 'bg-red-500'
                    }`}
                  />
                </div>
              </motion.div>
            );
          })}
        </motion.div>
      )}
    </motion.div>
  );
};

export default StudentResultsPage;
